/**
 * Component for the top-level nav icons in <GlobalHeader>
 * This component is responsible for maintaining all data for each nav item.
 * @category Modules - Web
 * @subcategory GlobalHeader
 * @namespace GlobalNav
 */
export default function GlobalNav(props) {
  const { selectedNavItemRoute, setNavRoute } = props
  const [showTabletWidth, setShowTabletWidth] = useState(false)
  const [showScrollRight, setShowScrollRight] = useState(true)
  const [showScrollLeft, setShowScrollLeft] = useState(true)
  const scrollContainer = useRef(null)
  const routesForUserSet = useAccessibleRoutes()
  // can't useParams since we are outside of the router
  const caseIdParam = selectedNavItemRoute.includes(routes.CASES) ? selectedNavItemRoute.split('/')[2] : null

  /**
   * If the need arises to have more components hook into the window resize,
   * lets try to find more a react-friendly way for the components to handle a window event
  */
  window.addEventListener('resize', handleWindowResize)

  useEffect(function didMount() {
    /** Checks screen width to display in tablet style if necessary */
    const tabletWidth = parseInt(globalMediaQueries.tabletWidth.substr(0, 3))
    if (window.innerWidth < tabletWidth) setShowTabletWidth(true)

    /** Remove window resize listener */
    return () => {
      window.removeEventListener('resize', handleWindowResize)
    }
  }, [])

  useEffect(function didUpdate() {
    /** Checks scrollContainer after it first renders to determine scroll visuals of navBar */
    const scrollElement = scrollContainer.current
    if (scrollElement) checkScrollPosition(scrollElement)
  }, [scrollContainer.current])

  /** Scroll handler that checks if the window's innerWith should display tablet styling */
  function handleWindowResize() {
    const tabletWidth = parseInt(globalMediaQueries.tabletWidth.substr(0, 3))
    if (!showTabletWidth && (window.innerWidth < tabletWidth)) {
      setShowTabletWidth(true)
      const scrollElement = scrollContainer.current
      if (scrollElement) checkScrollPosition(scrollElement)
    }
    else if (showTabletWidth && (window.innerWidth > tabletWidth)) {
      setShowTabletWidth(false)
    }
  }
  /**
   * Click handler for nav item - params should map to 'navItems' above
   * @param {string} route
   * @param {string} analyticsAction
   */
  function handleNavItemClick(route, analyticsAction) {
    if (route !== selectedNavItemRoute) {
      if (analyticsAction === 'Clicked') {
        analyticsService.logEvent('Time Tracking', analyticsAction, 'Time Tracking Report')
      }
      analyticsService.logEvent('WebNavigation', analyticsAction)
    }
    setNavRoute(route)
  }

  /**
   * Scroll handler for sideways nav bar scroll
   * @param {object} target - the target of the scrolling, which can come from an event or a ref
   */
  function checkScrollPosition(target) {
    if (target.scrollLeft <= 0) {
      setShowScrollLeft(false)
    }
    else if (target.scrollLeft >= target.scrollLeftMax) {
      setShowScrollRight(false)
    }
    else if (!showScrollLeft || !showScrollRight) {
      setShowScrollLeft(true)
      setShowScrollRight(true)
    }
  }

  let selectedNavItemName = ''
  const navItemsCollection = navItems
    .filter(navItem => routesForUserSet.has(navItem.route))
    .map(navItem => {
      const {name, route, icon, analyticsAction} = navItem

      let isSelected = false
      if (selectedNavItemRoute.includes(route)) {
        isSelected = true
        selectedNavItemName = name
      }

      return (
        <NavItem
          key={'nav-'+name}
          name={name}
          icon={icon}
          isSelected={isSelected}
          handleClick={() => handleNavItemClick(route, analyticsAction)}
        />
      )
    })
  if (!selectedNavItemName) {
    // No nav item selected, we are on a case route or an 'other' route
    selectedNavItemName = caseIdParam || otherRoutesToPageTitleMap.get(selectedNavItemRoute)
  }

  let navItemComponents = <NavItems>{navItemsCollection}</NavItems>
  // Displays the navItems within a scrollable component if screen width is tablet sized
  if (showTabletWidth) {
    navItemComponents = (
      <DivNavItemScrollContainer
        ref={scrollContainer}
        onScroll={(event) => checkScrollPosition(event.target)}
      >
        {
          showScrollLeft &&
          <DivScrollIndicator />
        }
        <NavItems>
          {navItemsCollection}
        </NavItems>
        {
          showScrollRight &&
          <DivScrollIndicator alignRight={true} />
        }
      </DivNavItemScrollContainer>
    )
  }

  return (
    <DivGlobalNavContainer>
      {navItemComponents}
      { selectedNavItemName &&
        <DivPageTitle>
          <img src={blueHeaderTab} alt='Current Page Name'/>
          <p>{selectedNavItemName}</p>
        </DivPageTitle>
      }
    </DivGlobalNavContainer>
  )
}

